import { useEffect, useState } from "react";
import { getAllOrders } from "../../api/orderApi";

function OrdersList() {
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    getAllOrders().then(setOrders);
  }, []);

  return (
    <div>
      <h2>Orders</h2>

      <table border="1" cellPadding="8">
        <thead>
          <tr>
            <th>ID</th>
            <th>Deliverer</th>
            <th>Date</th>
            <th>Time</th>
            <th>Total Price</th>
          </tr>
        </thead>
        <tbody>
          {orders.map(o => (
            <tr key={o.orderId}>
              <td>{o.orderId}</td>
              <td>{o.userId}</td>
              <td>{o.date}</td>
              <td>{o.time}</td>
              <td>{o.orderPrice} â‚º</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default OrdersList;
